import React from 'react';
 import './Section.css';
import image1 from './Images/image1';


function Section() {
  return (
    <div className="section-container">
      <div className="title">
        <h1>Optimisation énergétique</h1>
        <p>
        GreenLaz vous permet de visualiser vos données multi-sites et de piloter vos données de consommation (eau, gaz, électricité…),… De maîtriser et centraliser vos factures énergétiques.
        </p>
        <button className="discover-button">
          Découvrir <span className="arrow">→</span>
        </button>
      </div>
      <div className="section-image">
        <img src="path-to-your-image.png" alt="Description de l'image" />
      </div>
    </div>
  );
}

export default Section;
